import Contact from './components/Contact/contact';
import Footer from './components/Footer/footer';
import Project from './components/Project/project';

function App() {
  return (
    <div className="App">
<Navbar/>
<Intro/>
<Skills/>
<Project/>
<Contact/>
<Footer/>

    </div>
  );
}

export default App;
